import menu from "./menu.js";
import "./css/GlobalNav.css"

function GlobalNav({ className, onNav }) {

  const list = menu.map(item => {
    return (
      <li className="global-nav-item" key={item.name}>
        <a
          onClick={onNav}
          href={item.path} className="global-nav-link">{item.name}</a>
      </li>
    )
  })

  return (
    <nav className={`global-nav ${className}`}>


      <ul className={`global-nav-list `}>


        <li className="global-nav-item" >
          <a onClick={onNav} href="/" className="global-nav-link">Homepage</a>
        </li>
        <li className="global-nav-item" >
          <a onClick={onNav} href="/Highlight.html" className="global-nav-link">Highlight</a>
        </li>
        <li className="global-nav-item" >
          <a onClick={onNav} href="/Gallery.html" className="global-nav-link">Gallery</a>
        </li>


        <li className="global-nav-item" >
          <a onClick={onNav} href="/About.html" className="global-nav-link">About</a>

          <ul className="drop">
            {list}
          </ul>


        </li>

      </ul>

    </nav>


  );
}

export default GlobalNav;
